import "./about-us.css";

const aboutUs = () => {

    const img1_info = '';
    const img2_info = '';
    const img3_info = '';
    return (
        <>
            <section>
                <div className="container">
                    <article className="section-about-us">
                        <section className="section-about-us__info">
                            <div className="section-about-us__subtitle">
                                <div className="line-dark"></div>
                                <h2>¿Qué hacemos?</h2>
