                        <section className="section-about-us__images">
                            <div className="section-about-us__container-img">
                                <figure className="section-about-us__img-circles">
                                    <img src={img3} alt={img3_info} />
                                </figure>
                                <figure className="section-about-us__img">
                                    <img src={img1} alt={img1_info} />
